    const pageNumbers = []
                                    //5
    for(let i=0 ; i< Math.ceil(allRecipes/recipePerPage); i++){
        pageNumbers.push(i+1)
    }
    console.log(pageNumbers)
    return(
        <nav>
            <ul>
                {
                    pageNumbers.map((number)=>{
                        return(
                            <li className='li' onClick={()=>Paginado(number)}><a href="#">{number}</a></li>
                        )
                    })
                }
            </ul>
        </nav>
    )
}
